import React, { useState } from "react";
import logo from '.././images/logo.svg';

function Home() {
    return (
        <div>
            <img src={logo} className="App-logo" alt="logo" />
            <p>
                R2D2 Project
            </p>
            <p>
                R2D2 Project
            </p>
        </div>
    );
}

export default Home;
